&lt;h2 class=&quot;h4&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Bestill time p&amp;aring; nett for&amp;nbsp;&amp;aring; s&amp;oslash;ke om&amp;nbsp;pass og ID-kort. Vi har ikke drop-in.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Passbilde&lt;/h2&gt;
&lt;p&gt;Det skal ikke tas med foto til ordin&amp;aelig;rt pass eller ID-kort. Det tas bilde via opptak av biometri. Ved s&amp;oslash;knad om n&amp;oslash;dpass, m&amp;aring; passfoto medbringes.&lt;/p&gt;

&lt;h2 class=&quot;h4&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Bestill time p&amp;aring; nett for &amp;aring; s&amp;oslash;ke pass og ID-kort. Vi har ikke drop-in.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;K&amp;oslash;lappsystem&lt;/h2&gt;
&lt;p&gt;Tast inn ditt bestillingsnummer automaten ved inngangen. Du vil da f&amp;aring; en k&amp;oslash;lapp. F&amp;oslash;lg med p&amp;aring; infoskjermene, som viser n&amp;aring;r det blir din tur.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;N&amp;oslash;dpass:&lt;/strong&gt;&lt;br /&gt;Vi utsteder ikke n&amp;oslash;dpass i Ski.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Passbilde&lt;/strong&gt;&lt;br /&gt;Det skal ikke tas med foto til ordin&amp;aelig;rt pass eller ID-kort. Det tas bilde via opptak av biometri.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Parkering&lt;/strong&gt;&lt;br /&gt;Vi har egne parkeringsplasser utenfor publikumsmotaket&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;h2 class=&quot;h3&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Du kan &lt;a href=&quot;https://pass-og-id.politiet.no/timebestilling/index.html#/preselect/branch/e8cfd353ad2e1f03432faa6d1c1ea3401102eb0bf7e8f9e9fe0e2607f867a8a0&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;bestille time&amp;nbsp;p&amp;aring; nett&lt;/a&gt; tidligst 120 dager fram i tid for &amp;aring; s&amp;oslash;ke pass og ID-kort. Avbestilling kan du gj&amp;oslash;re via lenken du mottar p&amp;aring; sms ved bestilling.&amp;nbsp;&lt;br /&gt;Verken Sandvika eller Gr&amp;oslash;nland har drop-in. &lt;a href=&quot;/link/17a269d605a64b73a6748c3b541863f9.aspx#N%C3%B8dpass&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;S&amp;oslash;knad om n&amp;oslash;dpass&lt;/a&gt;&amp;nbsp;m&amp;aring; gj&amp;oslash;res p&amp;aring;&amp;nbsp;Gr&amp;oslash;nland politistasjon (Politihuset i Oslo), Gr&amp;oslash;nlandsleiret 44 i&amp;nbsp;Oslo.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;Bilde til pass og ID-kort&lt;/h2&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass og/eller ID-kort, dette gjelder ogs&amp;aring; barn under 3 &amp;aring;r. N&amp;aring;r du s&amp;oslash;ker om nytt pass/ID-kort tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskelig &amp;aring; ta bilde med biometrikiosken, bruker vi et h&amp;aring;ndholdt kamera. Passbilde fra fotograf eller fotoautomat skal ikke brukes, og vi tar ikke i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;K&amp;oslash;lappsystem&lt;/h2&gt;
&lt;p&gt;Tast inn ditt&amp;nbsp;mobilnummer p&amp;aring; automaten ved inngangen. Du vil da f&amp;aring; en k&amp;oslash;lapp. Infoskjermene&amp;nbsp;viser n&amp;aring;r det blir din tur.&lt;/p&gt;

&lt;h2 class=&quot;h3&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Du kan &lt;a href=&quot;https://pass-og-id.politiet.no/timebestilling/index.html#/&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;bestille time p&amp;aring; nett&lt;/a&gt; 120 dager fram i tid for &amp;aring; s&amp;oslash;ke pass og ID-kort. Avbestilling kan du gj&amp;oslash;re i bekreftelses sms-en du mottar ved bestilling.&lt;/p&gt;
&lt;h2 class=&quot;h4 h3&quot;&gt;Forsinket til time?&lt;/h2&gt;
&lt;p&gt;Du&amp;nbsp;m&amp;aring; ikke gi beskjed om du er forsinket. Dersom du ikke m&amp;oslash;ter til avtalt tid, mister du timen og m&amp;aring; bestille ny p&amp;aring; nett. &lt;br /&gt;NB! Ekstra k&amp;oslash;-st&amp;aring;ing utenfor, for &amp;aring; ivareta smittevernshensyn, gj&amp;oslash;r ikke at du mister timen selv om du slippes inn litt senere enn avtalt time.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Bilde til pass og ID-kort&lt;/h2&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass og ID-kort, ogs&amp;aring; barn under 3 &amp;aring;r. &lt;br /&gt;N&amp;aring;r du s&amp;oslash;ker om nytt pass og/eller ID-kort&amp;nbsp;tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskelig &amp;aring; ta bilde med biometrikiosken, bruker vi et h&amp;aring;ndholdt kamera. Passbilde fra fotograf eller fotoautomat skal ikke brukes i passet, og vi tar ikke i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h4 h3&quot;&gt;K&amp;oslash;lappsystem&lt;/h2&gt;
&lt;p&gt;Tast inn ditt mobilnummer i automaten ved inngangen. Du vil da f&amp;aring; en k&amp;oslash;lapp. Infoskjermene viser n&amp;aring;r det blir din tur.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;N&amp;oslash;dpass&lt;/h2&gt;
&lt;p&gt;Merk at det er egne &lt;a href=&quot;/link/17a269d605a64b73a6748c3b541863f9.aspx&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;&amp;aring;pningstider for n&amp;oslash;dpass&lt;/a&gt;. Les om &lt;a href=&quot;/link/1ebb4eeacc2540d7ac2c8c5778dfa7b8.aspx&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;kriteriene for &amp;aring; f&amp;aring; utstedt n&amp;oslash;dpass&lt;/a&gt; f&amp;oslash;r du m&amp;oslash;ter opp.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;NB!&lt;/h2&gt;
&lt;p&gt;Det ikke er tillatt &amp;aring; medbringe elektriske sparkesykler inn i publikumslokalet.&lt;/p&gt;

&lt;h2 class=&quot;h4&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Bestill time p&amp;aring; nett for &amp;aring; s&amp;oslash;ke pass og ID-kort. Det er ikke mulighet for drop-in.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Passbilde&lt;/h2&gt;
&lt;p&gt;Det skal ikke tas med foto til ordin&amp;aelig;rt pass eller ID-kort. Det tas bilde via opptak av biometri. Ved s&amp;oslash;knad om n&amp;oslash;dpass, m&amp;aring; passfoto medbringes.&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;N&amp;aring;r du m&amp;oslash;ter til time&lt;/h2&gt;
&lt;p&gt;Det&amp;nbsp;er et begrenset antall parkeringsplasser for bes&amp;oslash;kende utenfor politihuset. Vi oppfordrer deg derfor til&amp;nbsp;&amp;aring; komme i god tid f&amp;oslash;r avtalen din. Dersom du ikke m&amp;oslash;ter til avtalt time, m&amp;aring; du booke ny avtale.&lt;/p&gt;

&lt;h2 class=&quot;h3&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Publikum skal bestille time p&amp;aring; nett for &amp;aring; s&amp;oslash;ke pass. Det er ikke mulighet for drop-in. N&amp;oslash;dpass utstedes ved Gj&amp;oslash;vik politihus.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;Passbilde&lt;/h2&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass, ogs&amp;aring; barn under 3 &amp;aring;r. &lt;br /&gt;N&amp;aring;r du s&amp;oslash;ker om nytt pass tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskelig &amp;aring; ta bilde med biometrikiosken, bruker vi et h&amp;aring;ndholdt kamera. Passbilde fra fotograf eller fotoautomat skal ikke brukes i passet, og vi tar ikke i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h3&quot;&gt;Forsinket til time?&lt;/h2&gt;
&lt;p&gt;Du trenger ikke &amp;aring; ringe oss om du er forsinket til time. Kommer du for sent, blir timen slettet og du m&amp;aring; bestille ny time en annen gang.&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;* Det tilbys ikke lenger &quot;drop-in&quot; for annet enn n&amp;oslash;dpass. Bestill time i timebestillingsskjemaet for &amp;aring; f&amp;aring; nytt pass.&lt;/p&gt;
&lt;h3 class=&quot;h4&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h3&gt;
&lt;p&gt;Bestill time i lenken over for &amp;aring; s&amp;oslash;ke pass.&lt;/p&gt;
&lt;p&gt;&lt;a href=&quot;/link/94896d8e9fd4441d8d57f83615c69341.aspx&quot;&gt;Les hva du &lt;strong&gt;m&amp;aring;&lt;/strong&gt; ha med til pass&amp;ndash; og ID-kontoret&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;Manglende dokumentasjon kan medf&amp;oslash;re at du blir sendt hjem og m&amp;aring; bestille ny time.&lt;/p&gt;
&lt;h3 class=&quot;h4&quot;&gt;K&amp;oslash;lappsystem&lt;/h3&gt;
&lt;p&gt;Tast inn ditt bestillingsnummer i automaten ved inngangen n&amp;aring;r du kommer. Du vil da f&amp;aring; en k&amp;oslash;lapp. F&amp;oslash;lg med p&amp;aring; infoskjermene, som viser n&amp;aring;r det blir din tur.&lt;/p&gt;
&lt;h3 class=&quot;h4&quot;&gt;Passbilde&lt;/h3&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass, ogs&amp;aring; barn under 3 &amp;aring;r. N&amp;aring;r du s&amp;oslash;ker om nytt pass tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskelig &amp;aring; ta bilde med biometrikiosken, bruker vi et h&amp;aring;ndholdt kamera.&lt;br /&gt;&lt;br /&gt;Passbilde fra fotograf eller fotoautomat brukes kun i n&amp;oslash;dpass og vi tar ikke i mot dette for andre pass.&lt;/p&gt;
&lt;h3 class=&quot;h4&quot;&gt;Forsinket til timen?&lt;/h3&gt;
&lt;p&gt;Du trenger ikke ringe oss hvis du er forsinket til timen din. Kommer du for sent blir timen slettet, og du m&amp;aring; bestille en ny.&lt;/p&gt;

&lt;h2 class=&quot;h3&quot;&gt;Om mobilt pass&amp;ndash; og ID-kontor (passbuss)&lt;/h2&gt;
&lt;p&gt;Mobilt pass&amp;ndash; og ID-kontor (passbuss) er en bil som kj&amp;oslash;rer mellom ulike stoppesteder over hele Norge. Bilen har utstyr som gj&amp;oslash;r at du kan s&amp;oslash;ke om pass og nasjonalt ID-kort.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;Det er to biler i Norge som skal dekke store omr&amp;aring;der, og det er derfor lenge mellom timeavtalene p&amp;aring; hvert stoppested. Du finner ledig time for dette stoppestedet ved &amp;aring; klikke p&amp;aring; den bl&amp;aring; knappen over, og bla deg fremover i kalenderen.&amp;nbsp;&lt;/p&gt;
