&lt;h2 class=&quot;h4&quot;&gt;Oppm&amp;oslash;te&lt;/h2&gt;
&lt;p&gt;Passkontoret i Haugesund har flyttet til Politiets forvaltingssenter i S&amp;oslash;rhauggata 128.&lt;/p&gt;
&lt;p&gt;Passkontoret har &amp;aring;pent mandag-fredag kl. 09.00-14.00. Det er stengt alle helligdager.&lt;/p&gt;
&lt;p&gt;Det er kun &amp;aring;pent for timebestillinger. Det er kun den som skal ha pass som skal m&amp;oslash;te til timen, i tillegg til foreldre dersom det gjelder pass til barn. Oppm&amp;oslash;te tidligst 5 minutter f&amp;oslash;r bestillt time. For n&amp;oslash;dpass, henting av pass eller fullmakt; kontakt Passkontoret i Haugesund p&amp;aring; tlf 52868030. For n&amp;oslash;dpass utenom &amp;aring;pningstidene, kontakt Stavanger lufthavn. &lt;strong&gt;HUSK &amp;Aring; TA MED GAMMELT PASS!&lt;/strong&gt;&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Passbilete&lt;/h2&gt;
&lt;p&gt;Passkontoret tar bilde til passet. N&amp;aring;r du s&amp;oslash;ker om nytt pass tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp.&lt;/p&gt;
&lt;p&gt;Passbilde fra fotograf eller fotoautomat kan ikke brukes i passet, og vi tar derfor ikke i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Forsinka til timen?&lt;/h2&gt;
&lt;p&gt;Du trenger ikke &amp;aring; ringe oss om du er forsinka til timen. Kommer du for sent blir timen sletta, og du m&amp;aring; bestille ny time en annen gang.&lt;/p&gt;

