freetextBlocks.text:
&lt;h2 class=&quot;h4&quot;&gt;Oppm&amp;oslash;te&lt;/h2&gt;
&lt;p&gt;Vi anbefaler deg &amp;aring; bestille time p&amp;aring; nett. &lt;strong&gt;HUGS &amp;Aring; TA MED GAMALT PASS!&lt;/strong&gt;&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Passbilete&lt;/h2&gt;
&lt;p&gt;Passkontoret tar bilete til passet. N&amp;aring;r du s&amp;oslash;ker om nytt pass tar vi bilete med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskeleg &amp;aring; ta bilete med biometrikiosken, bruker vi et handhaldt kamera.&lt;/p&gt;
&lt;p&gt;Passbilete fr&amp;aring; fotograf eller fotoautomat skal ikkje brukast i passet, og vi tar ikkje i mot dette.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Betaling&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Du betalar gebyret p&amp;aring; pass&amp;ndash; og ID-kontoret. Du kan betale med kontantar eller bankkort. Du kan ikkje betale med kredittkort (for eksempel Mastercard), utanlandske bankkort, Vipps eller andre mobil- eller smartklokkel&amp;oslash;ysingar.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;K&amp;oslash;lappsystem&lt;/h2&gt;
&lt;p&gt;Tast inn bestillingsnummeret ditt i automaten ved inngangen. Du vil da f&amp;aring; ein k&amp;oslash;lapp. F&amp;oslash;lg med p&amp;aring; infoskjermane, som viser n&amp;aring;r det blir din tur.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Forsinka til timen?&lt;/h2&gt;
&lt;p&gt;Kjem du for seint vert timen sletta. Vi vil pr&amp;oslash;ve &amp;aring; f&amp;aring; plass til deg innimellom andre kundar men du kan m&amp;aring;tte vente litt.&lt;/p&gt;

blocks.text:
&lt;p&gt;Timebestilling kan kun gj&amp;oslash;res via &lt;a href=&quot;/link/7971188051764d2e98bba4b581c5014c.aspx&quot;&gt;v&amp;aring;r nettl&amp;oslash;sning&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;Parkering p&amp;aring; P1 Korttid og i P4 P-hus vil koste kr 10 for f&amp;oslash;rste p&amp;aring;begynte time. Etter dette beregnes ordin&amp;aelig;r takst.&amp;raquo;&lt;/p&gt;
&lt;p&gt;Registreringsnummer m&amp;aring; oppgis p&amp;aring; passkontoret.&lt;/p&gt;
&lt;p&gt;Her finner du pristabell og kart over omr&amp;aring;dene: &lt;a href=&quot;https://avinor.no/flyplass/stavanger/parkering/Priser/&quot;&gt;https://avinor.no/flyplass/stavanger/parkering/Priser/&lt;/a&gt;&lt;/p&gt;

