&lt;p&gt;&lt;strong&gt;Betaling&lt;br /&gt;&lt;/strong&gt;Vi aksepterer ikke betaling via smartklokke.&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;h2 class=&quot;h4&quot;&gt;Timebestilling p&amp;aring; nett&lt;/h2&gt;
&lt;p&gt;Alle skal bestille time p&amp;aring; nett for &amp;aring; s&amp;oslash;kje om pass og ID-kort. Oppm&amp;oslash;te utan avtale er ikkje mogleg. M&amp;oslash;t opp litt f&amp;oslash;r avtalt time, og registrer deg n&amp;aring;r du kjem. Du vert ropt opp med namn n&amp;aring;r det er din tur.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Bilde til pass og ID-kort&lt;/h2&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass og ID-kort, ogs&amp;aring; barn under 3 &amp;aring;r. &lt;br /&gt;N&amp;aring;r du s&amp;oslash;ker om nytt pass og/eller ID-kort tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Passbilde fr&amp;aring; fotograf eller fotoautomat er ikkje gyldig for bruk i pass og ID-kort, og vi tar ikkje i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Forsinka til timen?&lt;/h2&gt;
&lt;p&gt;Ring og gje beskjed om du vert forsinka. Vi vil pr&amp;oslash;ve &amp;aring; f&amp;aring; plass til deg innimellom andre kundar, men du kan m&amp;aring;tte vente litt.&lt;/p&gt;

