&lt;p&gt;&lt;strong&gt;Timebestilling p&amp;aring; nett&lt;/strong&gt;&lt;br /&gt;Alle skal bestille time p&amp;aring; nett for &amp;aring; s&amp;oslash;kje om pass og ID-kort. Oppm&amp;oslash;te utan avtale er ikkje mogleg. Du kan eventuelt ringje oss, so kan vi ordne time til deg. M&amp;oslash;t opp litt f&amp;oslash;r avtalt time.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Bilete til pass og id-kort&lt;/strong&gt;&lt;br /&gt;Vi tek bilete med biometrikiosken av alle som s&amp;oslash;kjer om pass/id-kort, ogs&amp;aring; av sm&amp;aring; born.&lt;br /&gt;Passbilete fr&amp;aring; fotograf kan ikkje nyttast.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Forsinka til timen?&lt;/strong&gt;&lt;br /&gt;Ring og gje beskjed om du vert forsinka. &lt;br /&gt;Vi vil pr&amp;oslash;ve &amp;aring; f&amp;aring; plass til deg innimellom andre kundar, men kanskje du m&amp;aring; vente litt.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;K&amp;oslash;lappsystem&lt;/strong&gt;&lt;br /&gt;N&amp;aring;r du kjem, m&amp;aring; du registrere deg med telefonnummer p&amp;aring; automaten som st&amp;aring;r innanfor d&amp;oslash;ra. Du vil f&amp;aring; ein k&amp;oslash;lapp, og m&amp;aring; f&amp;oslash;lgje med p&amp;aring; informasjonsskjerm, som viser n&amp;aring;r det er din tur.&lt;/p&gt;
