&lt;h2 class=&quot;h4&quot;&gt;K&amp;oslash;lappsystem&lt;/h2&gt;
&lt;p&gt;Tast inn ditt mobilnummer p&amp;aring; automaten ved inngangen. Du vil da f&amp;aring; en k&amp;oslash;lapp. F&amp;oslash;lg med p&amp;aring; infoskjermene, som viser n&amp;aring;r det blir din tur.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Passbilde&lt;/h2&gt;
&lt;p&gt;&lt;br /&gt;N&amp;aring;r du s&amp;oslash;ker om nytt pass, tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskelig &amp;aring; ta bilde med biotremikiosken, bruker vi h&amp;aring;ndholdt kamera. Passbilde fra fotograf eller fotoautomat skal ikke brukes, og vi tar ikke i mot dette.&lt;/p&gt;
&lt;h2 class=&quot;h4&quot;&gt;Forsinket til timen?&lt;/h2&gt;
&lt;p&gt;Du trenger ikke ringe oss hvis du er forsinket til timen din. Kommer du for sent blir timen slettet, og du m&amp;aring; bestille en ny.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Oppm&amp;oslash;te&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Alle m&amp;aring; bestille time hos politiet p&amp;aring; politet.no f&amp;oslash;r oppm&amp;oslash;te. Du kan bestille time p&amp;aring; nett 60 dagar fram i tid for &amp;aring; s&amp;oslash;ke om pass og ID-kort. Det er ikkje ope for drop-in. Stengt alle helgedagar.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;K&amp;oslash;lappsystem&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Tast inn telefonnummeret ditt i automaten ved inngangen. Du vil d&amp;aring; f&amp;aring; ein k&amp;oslash;lapp. Informasjonsskjermane viser n&amp;aring;r det er din tur.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;For sein til timen?&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Kjem du for seint, vert timen sletta. Gi beskjed med ein gong du er p&amp;aring; plass. Du vert d&amp;aring; ekspedert ved f&amp;oslash;rste ledige tidspunkt, men rekn med at du kanskje m&amp;aring; vente ei stund.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Endre eller avbestille time?&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Hvis timen ikkje passar, m&amp;aring; du endre tidspunkt eller avbestille han.&lt;/p&gt;
&lt;ol&gt;
&lt;li&gt;&amp;Aring;pn SMS-en du fekk med stadfesting p&amp;aring; timen.&lt;/li&gt;
&lt;li&gt;Klikk p&amp;aring; lenka. D&amp;aring; kan du velge om du skal endre eller avbestille timen.&lt;/li&gt;
&lt;/ol&gt;
&lt;p&gt;Har du ikke mottatt SMS, m&amp;aring; du ringe pass&amp;ndash; og ID-kontoret&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Passfoto og spesielt om born under 3 &amp;aring;r&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Vi tar bilde av alle som s&amp;oslash;ker om pass og ID-kort, ogs&amp;aring; barn under 3 &amp;aring;r. &lt;br /&gt;N&amp;aring;r du s&amp;oslash;ker om nytt pass og/eller ID-kort tar vi bilde med biometrikiosken n&amp;aring;r du m&amp;oslash;ter opp. Hvis det er vanskeleg &amp;aring; ta bilde med biometrikiosken, bruker vi eit h&amp;aring;ndholdt kamera. Passbilde fr&amp;aring; fotograf eller fotoautomat skal ikkje brukast i passet, og vi tar ikkje i mot dette.&lt;/p&gt;
&lt;p&gt;Har du behov for n&amp;oslash;dpass, m&amp;aring; du ta med ett passfoto i fargar.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Signert originalt samtykke (fullmakt)&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;S&amp;oslash;ker du om pass eller ID-kort med reiserett til barn og ungdom under 18 &amp;aring;r, eller ID-kort uten reiserett til barn under 13 &amp;aring;r, m&amp;aring; minst ein av foreldra m&amp;oslash;te opp saman med barnet. Hvis berre ein av foreldra m&amp;oslash;ter opp, m&amp;aring; du ha med:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Ditt eige og barnets pass. Hvis du ikkje har pass fr&amp;aring; f&amp;oslash;r, m&amp;aring; du ta med annan gyldig legitimasjon.&lt;/li&gt;
&lt;li&gt;Passet eller stadfesta kopi (rett kopi) av passet for den av foreldra som ikkje m&amp;oslash;ter opp. Hvis han eller ho ikkje har pass fr&amp;aring; f&amp;oslash;r, m&amp;aring; du f&amp;aring; med annan gyldig legitimasjon eller stadfesta kopi (rett kopi) av denne.&lt;/li&gt;
