&lt;p&gt;Tast inn ditt bestillingsnummer p&amp;aring; automaten ved inngangen. Du vil da f&amp;aring; en k&amp;oslash;lapp. F&amp;oslash;lg med p&amp;aring; infoskjermene, som viser n&amp;aring;r det blir din tur.&lt;/p&gt;
